import java.util.*;public class Main {    public static void main(String[] args) {        Scanner sc = new Scanner(System.in);        int t = sc.nextInt();        while (t -- > 0) {            int n = sc.nextInt();            int[] a = new int[n];            for (int i = 0; i < n; i ++) {                a[i] = sc.nextInt();            }            boolean ok = false;            int limit = 1 << n;            for (int mask = 1; mask < limit && !ok; mask ++) {                long prod = 1;                for (int i = 0; i < n; i ++) {                    if (((mask >> i) & 1) == 1) {                        prod *= a[i];                        if (prod > 67) {                            break;                        }                    }                }                if (prod == 67) {                    ok = true;                }            }            System.out.println(ok ? "YES" : "NO");        }    }}